import React, { useState } from "react";
import Dashboard from "./components/Dashboard";

const App = () => {
  const [userId, setUserId] = useState(null);

  const handleLogin = (id) => {
    setUserId(id);
  };

  return (
    <div>
      {userId === null ? (
        <Login onLogin={handleLogin} />
      ) : (
        <Dashboard userId={userId} />
      )}
    </div>
  );
};

export default App;
